data = DATA.each_line.map(&:chomp)[0]

def reduce_polymer(polymer)
  i = 0
  while i < (polymer.length - 1)
    if polymer[i] ==  (polymer[i+1]).swapcase
      polymer.tap { |d| d.slice!(i, 2) }
      i = [0, i - 1].max
    else
      i += 1
    end
  end
  polymer
end

full_poly = reduce_polymer(data)

reduce_poly = ('a'..'z').to_a.map { |letter| reduce_polymer(data.gsub(/#{letter}/i, ''))}.each_with_index.max[0]

p "Part 1: #{full_poly.length}"
p "Part 2: #{reduce_poly.length}"

__END__

